import React from 'react';
import styled from 'styled-components';
import Header from '../components/Header';

const HomeContainer = styled.div`
  width: 100%;
`;

const HeroSection = styled.section`
  height: 100vh;
  background: linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7));
  background-size: cover;
  background-position: center;
  display: flex;
  align-items: center;
  justify-content: center;
  text-align: center;
  padding-top: 80px;
`;

const HeroContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px;
`;

const MainHeading = styled.h1`
  font-size: 4rem;
  color: #ffffff;
  margin-bottom: 20px;
  font-weight: 700;
`;

const SubHeading = styled.p`
  font-size: 1.5rem;
  color: #ffffff;
  margin-bottom: 40px;
  opacity: 0.9;
`;

const CTAButton = styled.button`
  padding: 15px 40px;
  font-size: 1.2rem;
  background-color: #f2381a;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  transition: background-color 0.3s ease;

  &:hover {
    background-color: #d42d15;
  }
`;

const Home = () => {
  return (
    <>
      <Header />
      <HomeContainer>
        <HeroSection>
          <HeroContent>
            <MainHeading>Neutek Nursing Services</MainHeading>
            <SubHeading>Professional Healthcare Solutions for Your Needs</SubHeading>
            <CTAButton>Get Started</CTAButton>
          </HeroContent>
        </HeroSection>
      </HomeContainer>
    </>
  );
};

export default Home;
